import React, { Component } from "react";
import './App.css';
import CvEdExpForm from "./components/CvEdExpForm.js";
import uniqid from "uniqid";

class App extends Component {
  constructor (props) {
    super(props);
    this.handler = this.handler.bind(this);
    this.state = {
      cvInfos: [],
      generalInfos: {
        firstName: "",
        lastName: "empty",
        phoneNumber: "empty",
        email: "empty",
        age: "empty",
        id: uniqid(),
      }
    }

  }



  render() {

    return (

      <div className="containerBase">
      <h1>CV Application</h1>
      <CvEdExpForm/>
      </div>
    );
  }

}


export default App;
